import Login from "./pages/login/Login";
import { Navigate } from "react-router-dom";
import axios from "axios";
const ProtectedLogin1 = ({ children, user ,setfirst_name,setsecond_name}) => {
  console.log(user);
  console.log("user is there");
  if (!user) return <Navigate to="/"></Navigate>;
  else {
    const Email  = localStorage.getItem("hello");
    console.log(Email);
    axios
      .post("http://localhost:5000/req_data", Email)
      .then((response) => {
        console.log(response.data.message);
         setfirst_name(response.data.first_name)
         setsecond_name(response.data.second_name)
      })
      .catch(function (error) {
        console.log(error);
      });
    console.log("going to Profile_page");
  }
  return children;
};

export default ProtectedLogin1;
